  },
  {
    path: "images/samsmith.jpeg",
    title: "Pop",
    text: "Stay IN the current trend.",
  },
  {
    path: "images/spanish.jpeg",
    title: "Español",
    text: "Feel the beats, move your body!",
  },
];

